	let friends_cards_data = [
		{'id': 1, 'name': 'Vlad'},
		{'id': 1, 'name': 'Victor'},
		{'id': 1, 'name': 'Artur'},
		{'id': 1, 'name': 'Valera'},
		{'id': 1, 'name': 'LEra'},
	]
	return (
		<aside className='sidebar'>
			<div className="sidebar__title">Friends</div>
			<div className="sidebar__body">
				<FriendCard name="Vlad" />
			</div>
		</aside>
	)
}

export default SideBar;
